import React, { Component } from "react";
import $ from "jquery";

class events extends Component {
  componentDidMount() {
    console.log($(".name").val());

    const script = document.createElement("script");
    script.async = true;
    script.src = "../instagramfeed.js";
    this.div.appendChild(script);

    const script2 = document.createElement("script");
    script2.async = true;
    script2.src = "../instagramrender.js";
    this.div.appendChild(script2);
  }
  render() {
    return (
      <div className="events" ref={(el) => (this.div = el)}>
        <h1> Instagram Feed </h1>
        {/* <input className="name" value="Mau" /> */}

        <form id="myForm" autoComplete="off">
          <input
            type="text"
            id="username"
            plpaceholder="Enter Username"
            required
          />
          <input type="submit" value="Search" />
        </form>
        <div id="instagram-feed-demo" className="instagram_feed"></div>
        {(function ($) {
          $(window).on("load", function () {
            $.instagramFeed({
              username: "instagram",
              container: "#instagram-feed1",
              display_profile: true,
              display_biography: true,
              display_gallery: true,
              display_captions: true,
              callback: null,
              styling: true,
              items: 8,
              items_per_row: 4,
              margin: 1,
              lazy_load: true,
              on_error: console.error,
            });
          });
        })(jQuery)}
      </div>
    );
  }
}

export default events;
